	add("feminism", "{\"term\":\"feminism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027féminisme\u0027 circa 1837, ultimately from Latin {{m|la|fēminīnus}}, from {{m|la|fēmina||woman}}. First recorded in English in 1851, originally meaning \u0026quot;the state of being feminine.\u0026quot; Sense of \u0026quot;advocacy of women\u0027s rights\u0026quot; is from 1895.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being feminine; femininity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1875\u0027\u0027 July 24, \u0027The Medical Times and Gazette\u0027, age 105\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"His hair is delicate and silky, and of a light chesnut — one of M. Lorrain\u0027s signs of \u0027\u0027feminism\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A social theory or political movement which argues that legal and social restrictions on women must be removed in order to bring about equality of both sexes in all aspects of public and private life\", \"priority\":4}]}, \"synonyms\":{}}");

	add("feminocentrism", "{\"term\":\"feminocentrism\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"See Latin \u0027femina\u0027 and English \u0027centre\u0027 \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"focus on women; a female-centered worldview\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Constance D. Harsh, \u0027Subversive heroines: feminist resolutions of social crisis in the condition-of-England novel\u0027\u0026lt;!---[http://books.google.com/books?id\u003dJDhaAAAAMAAJ\u0026amp;q\u003dfeminocentrism\u0026amp;dq\u003dfeminocentrism\u0026amp;hl\u003den\u0026amp;ei\u003d9xy_TpinEIKtiQK79IH3Ag\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d1\u0026amp;sqi\u003d2\u0026amp;ved\u003d0CDEQ6AEwAA]---\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Feminocentrism\u0027\u0027 and the Road to Female Empowerment At the onset of the riot scene in North and South, Margaret Hale is safely stationed with the Thornton family on the second floor of their home\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, Cecilia Reynolds, \u0027Women and school leadership: international perspectives\u0027, page 152\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"This method of inquiry is more holistic, as it goes beyond criticisms of androcentrism or \u0027\u0027feminocentrism\u0027\u0027 (the practice of viewing the world and shaping reality from a male lens then, conversely, from a female lens\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Suzanne Rodin Pucci, James Thompson, \u0027Jane Austen and Co: remaking the past in contemporary culture\u0027, page 249\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"As Laura Mulvey and many other film theorists have argued, this is a structural position that women rarely occupy in commercial cinema. Unsurprisingly, therefore, the \u0027\u0027feminocentrism\u0027\u0027 of the novels is cited by several of those involved in the recent productions\", \"priority\":7}]}, \"synonyms\":{}}");

	add("femismo", "{\"term\":\"femismo\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|female|machismo|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Exaggerated, stubborn, or aggressive femininity; female machismo\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Marilyn Maxwell, \u0027Male Rage, Female Fury: Gender and Violence in American Fiction\u0027, University Press of America (2000), ISBN 9780761818038, [http://books.google.com/books?id\u003du_FZAAAAMAAJ\u0026amp;q\u003d%22a+femismo%22\u0026amp;redir_esc\u003dy page 117\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Do these women, like Damon Cross in Wright\u0027s \u0027The Outsider\u0027 or Bigger Thomas in \u0027Native Son\u0027, succeed in establishing their own autonomy only through violence, forging a \u0026quot;\u0027\u0027femismo\u0027\u0027\u0026quot; or female counterpart to the \u0026quot;machismo\u0026quot; brutality of a Mailer protagonist\", \"priority\":3}]}, \"synonyms\":{}}");

	add("femme", "{\"term\":\"femme\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\"], \"text\":\"Used in Middle english (1100-1500) from Old french (842-ca. 1400) \u0027fame\u0027 et al. The modern spelling is under the influence of Middle and Modern French \u0027femme\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A woman, a wife, particularly in heraldry\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1885\u0027\u0027, Richard Burton, \u0027The Book of the Thousand Nights and a Night\u0027, Night 18\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Then I turned to him and said, \u0026quot;O my lord, I have that to propose to thee wherein thou must not cross me; and this it is that, when we reach Baghdad, my native city, I offer thee my life as thy handmaiden in holy matrimony, and thou shalt be to me baron and I will be \u0027\u0027femme\u0027\u0027 to thee.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A feminine lesbian, especially one who is attracted to masculine (butch) lesbians\", \"priority\":4}]}, \"synonyms\":{}}");

