	add("femslash", "{\"term\":\"femslash\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|fem|slash|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"slash Slash fiction that focuses on romantic and/or sexual relationships between female characters\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Phyllis M. Japp, ‎Mark Meister, ‎Debra K. Japp, \u0027Communication Ethics, Media \u0026amp; Popular Culture\u0027 (page 178\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The demographics of \u0027\u0027femslash\u0027\u0027 are a little more complicated than regular slash; stories are written by straight and lesbian women and sometimes straight men\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Stacey Abbott, \u0027The Cult TV Book\u0027 (page 245\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"One of the driving forces behind slash and \u0027\u0027femslash\u0027\u0027 is the pervading heterosexism of commercial media – if television will not give us the due proportion of same-sex eroticism we are entitled to expect, then we will make it for ourselves\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, John Lennard, \u0027London Review of Books\u0027, letter, vol. 35, no. 6\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The point of slash is that the orientation of one or more canonical characters is changed, which is why slashing is strongest in fandoms where the source parades heteronormativity or machismo. Kirk/Spock, Bodie/Doyle, Aragorn/Boromir, Darcy/Bingley and Harry/Snape stories all slash their canons, but a story featuring, say, Sebastian Flyte and Anthony Blanche in bed would not be slash, nor would a relationship between two lesbian characters in The L Word qualify as \u0027\u0027femslash\", \"priority\":7}]}, \"synonyms\":{}}");

